import './App.css';
import Tabs from './shared/components/Tab/Tab';
import MainHead from './MainHead';

function App() {
  routes = (
    <Switch>
      <Route path="/" exact>
        <Users />
      </Route>
      <Route path="/:userId/places" exact>
        <UserPlaces />
      </Route>
      <Route path="/auth">
        <Auth />
      </Route>
      <Redirect to="/auth" />
    </Switch>
  );

  return (
    <div className="App">   
    <MainHead></MainHead>
    <Tabs></Tabs>         
    </div>
  );
}
export default App;
